var length = modelData['ax'].length

// 30% margin of error
var epsilon = 0.4;

var fbaseRoot = new Firebase('https://justdanceforme.firebaseio.com/');

$(function() {
    'use strict';

    if (window.DeviceMotionEvent) {
        window.ondevicemotion = function(event) {
            var ax = event.acceleration.x;
            var ay = event.acceleration.y;
            var az = event.acceleration.z;
            // var rotation = event.rotationRate;

            $('ax').text(ax);
            $('ay').text(ay);
            $('az').text(az);

            var a = [ax, ay, az];

            // a = coordinateTransformation(a);

            a[0] = Math.abs(a[0]);
            a[1] = Math.abs(a[1]);
            a[2] = Math.abs(a[2]);

            // update max values
            if (a[0] > maxX) {
                maxX = a[0];
            }

            if (a[1] > maxX) {
                maxY = a[1];
            }

            if (a[2] > maxX) {
                maxZ = a[2];
            }
        };

        window.ondeviceorientation = function(event) {
            alpha = Math.round(event.alpha) - cal[0];
            beta = Math.round(event.beta) - cal[1];
            gamma = Math.round(event.gamma) - cal[2];

            $('alpha').text(alpha);
            $('beta').text(beta);
            $('gamma').text(gamma);
        };

        $('#calibrate').click(function() {
            cal[0] = Number($('alpha').text());
            cal[1] = Number($('beta').text());
            cal[2] = Number($('gamma').text());

            // $(this).css('display', 'none');
            $('#link').removeClass('disabled');
        });
    }

    fbaseRoot.authAnonymously(function(error, authData) {
        if(error) {
            throw error;
        }
        console.log('authenticated');
        console.log(authData);
        var laptopUID;
        // link to computer
        $('#link').on('click', function() {
            console.log('Clicked link');
            // access firebase and synchronize with laptop
            var code = $('#authCode').val();
            console.log('Linking with code: ' + code);
            if (code) {
                fbaseRoot.child('authCodes').child(code).once('value', function(snapshot) {
                    // If code has been entered
                    if(snapshot.exists()) {
                        laptopUID = snapshot.val().laptop;
                        fbaseRoot.child('authCodes').child(code).update({
                            mobile: authData.uid
                        }, function() {
                            console.log('Synced auth uids');
                            $('#ready').removeClass('disabled');
                        });
                    } else {
                        alert('That code is invalid. Please try again.');
                    }
                });
            }
        });

        // ready to start the game
        $('#ready').on('click', function() {
            console.log('Clicked ready');
            // access firebase and synchronize beginning
            if(laptopUID) {
                $(this).text('You are marked ready.');
                console.log(authData.uid);
                console.log(laptopUID);
                fbaseRoot.child('users').child(laptopUID).update({ready:true}, function(snapshot) {
                    console.log('Marked ready');

                    window.setInterval(function() {
                        if (modelData['ax'].length > 0) {
                            var score = 0;

                            var scoreX = 0, scoreY = 0, scoreZ = 0;

                            for (var i = 0; i < 10; i++) {
                                var modelValX = modelData['ax'].shift();
                                var modelValY = modelData['ay'].shift();
                                var modelValZ = modelData['az'].shift();

                                if (maxX >= modelValX * epsilon) {
                                    scoreX++;
                                }

                                if (maxY >= modelValY * epsilon) {
                                    scoreY++;
                                }

                                if (maxZ >= modelValZ * epsilon) {
                                    scoreZ++;
                                }
                                maxX = 0;
                                maxY = 0;
                                maxZ = 0;
                            }
                            score = (scoreX + scoreY + scoreZ) / 3;

                            if (score >= 3) {
                                score = 2;
                                combo++;
                            } else if (score > 0) {
                                combo++;
                            } else {
                                combo = 0;
                            }

                            var multiplier = 1;

                            if (combo >= 10) {
                                multiplier = 2;
                            }

                            totalScore += score * multiplier

                            fbaseRoot.child('users').child(laptopUID).child('results').set({
                                score: totalScore,
                                last_interval: score,
                                combo: combo
                            });
                        }
                    }, 1000);
                    // fbaseRoot.child('gameState').on('value', function(snap) {
                    //     alert('yay');
                    //     if(snap.val().running === true) {
                    //         // update the state
                            
                    //     }
                    // });
                });
            }
        });
    });
});
